pragma solidity ^0.5.0;

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "openzeppelin-solidity/contracts/lifecycle/Pausable.sol";

contract BNDESResolver is Ownable() {
    
    address logicContractAddr;
    address[] previousLogicContractsAddr;

    //IMPORTANT: The owner must have added the Resolver contract as a Pausable role to this contract.
    function changeLogicContractAddr(address newAddr) public
    onlyOwner()
    returns (bool)
    {
        if(newAddr != logicContractAddr) {
            
            Pausable pausableContract = Pausable(logicContractAddr);
            pausableContract.pause();
            
            previousLogicContractsAddr.push(logicContractAddr);
            logicContractAddr = newAddr;
            return true;
        }

        return false;
    }
    
    function getCurrentLogicVersionAddr() public view returns (address) {
        return logicContractAddr;
    }     
}
